                              if ($@) {
                                $@ =~ s/^\s+|\s+$//g;
                                my $err = new Thrift::TApplicationException("Unexpected Exception: " . $@, Thrift::TApplicationException::INTERNAL_ERROR);
                                $output->writeMessageBegin('getIdentityCredential', Thrift::TMessageType::EXCEPTION, $seqid);
